import api from '../config/Api';
import { Car } from '../components/Atoms/Carmodel';

const baseURL = 'https://eu-central-1.aws.data.mongodb-api.com/app/car-brmdzib/endpoint/cars'; // Base URL for ListEntry API

const CarService = {
    getCars: async (): Promise<any> => {
        try {
            const response = await api.post<any>(`${baseURL}`);
            return response.data;
        } catch (error) {
            throw new Error('Failed to Fetch Cars: Service');
        }
    },
};

export default CarService;
